Crotch Rocket Built for Snow!!

Crotch Rocket Snow Bike!

This video was done by professionals under the supervision of professionals on a closed course! 

In today’s video, we build the first ever Yamaha R6 Snow bike and it works extremely well riding in the deep mountain snow with all the snowmobiles in our pack! Until it locks up and we have to spend 12 hours towing it out of the backcountry!
